content.css:
.bowTieMainContainer {
  float: left;
  width: 100%;
  height: 100%;
  cursor: default;
  overflow-x: hidden;
}
.bowtieChartDestination > div,
.bowtieChartSource > div {
  float: left;
  width: 100%;
}
.bowtieChartSVGDestination > svg {
  width: 100%;
}
.bowtieChartSVGSource > svg {
  width: 100%;
}
.bowtieChartSVGDestination,
.bowtieChartDestination,
.bowtieChartSource,
.bowtieChartSVGSource {
  float: left;
}
.bowtieChartHeadings {
  margin-top: 10px;
  width: 100%;
  float: left;
  font-family: "Segoe UI Semibold";
  text-overflow: ellipsis;
  white-space: nowrap;
}
.alignment {
  vertical-align: middle;
}
.titleDivText {
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.bowtieChartAggregatedFBT {
  margin-right: "0%";
  float: left;
}
#divAggregatedSumFBT {
  text-align: center;
}
#indicatorFBT,
#indicatorHBT {
  margin-left: 2px;
  margin-bottom: -1px;
}
#fullBowtieSourceValue,
#fullBowtieDestSourceName,
#fullBowtieDestSourceValue,
#fullBowtieSourceName {
  float: left;
}
#fullBowtieDestSourceName {
  margin-left: 1%;
}
#fullBowtieDestSourceValue {
  text-align: left;
}
#bowtieChartAggregatedHBT {
  margin-right: 1%;
  float: left;
}
#divAggregatedSumHBT {
  float: right;
  text-align: right;
}
#alignmentFBTOne,
#alignmentSourceFBTOne {
  width: 50%;
  margin-right: 1%;
  vertical-align: middle;
}
#alignmentFBTTwo,
#alignmentSourceFBTTwo {
  width: 30%;
  vertical-align: middle;
}
#spanText,
#spanText1,
#sourceText,
#sourceText1 {
  cursor: pointer;
}
.bowtieChartSource {
  display: block;
  margin-left: 1%;
}
.bowtieChartSVGSource {
  margin-left: 1%;
  display: block;
}
.bowtieChartSVGDestination {
  margin-right: 1%;
}
.bowtieChartDestination {
  display: block;
  float: left;
}
#alignmentHBTOne {
  width: 49%;
  margin-right: 1%;
  vertical-align: middle;
}
.span1,
.span2 {
  cursor: pointer;
}
#alignmentHBTTwo {
  width: 50%;
}
#halfBowtieDestSourceName {
  margin-right: 1%;
  float: left;
}
#halfBowtieDestSourceVal {
  float: left;
}
.bowtieChartError {
  font-size: 12px;
  display: block;
  margin: 0 auto;
}
.titleDivText,
.titleDiv {
  display: inline-block;
}


/*# sourceMappingURL=visual.css.map*/
